import React from "react";
const CitiesListComponent = ({ cities }) => {
  return (
    <select>
      <option value="">Select a city</option>
      {cities.map((city) => (
        <option key={city} value={city}>
          {city}
        </option>
      ))}
    </select>
  );
};
export default CitiesListComponent;
